package com.c.conditional.practise;

public class ForEachDemo {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		String s[]= {"Bishnu","Gupta","Bimala","Ruku","Rupa","Rubina"};
		for(String a:s)
		{
			System.out.print(a);
			System.out.print(',');
		}
		System.out.println();

	}

}
